const Like = () => {
    const [liked, setLiked] = React.useState(null);
    const onClick = event => setLiked(this.ListeningStateChangedEvent({liked: true}));

    useEffect(() => {
        document.title = 'hi';
    }, [liked]);
    
 
        return (
            <button class="btn btn-info" onClick={() => setLiked(liked)}>
            {liked ? 'Like' : 'Liked'}
            </button>
        )
    

    

   
     

    

  };


export default Like;
